import React, {useState, useEffect} from 'react';
import './App.css';
import Axios from "axios";

function App() {
  const [timeLastUpdate, setTimeLastUpdate] = useState(0);
  const [topScoresList, setTopScoresList] = useState([]);

  const exportCsv = () => {
      //llamar a una api mia que me lo de en csv
  };


  useEffect(() => {
    const interval = setInterval(() => {
      Axios.get('http://localhost:3001/api/get').then((response) => {
        setTopScoresList(response.data);
        console.log("getting data pi pi pu pu");
      })
    }, 10000);
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="App">
      <h1> Top Scores </h1>
      {topScoresList.map((elem) => {
        return (
          <h2>
            <img src={elem.profile_image}></img> {elem.nickname}  <h2 className="score">Score: {elem.value}</h2> 
          </h2>
        );
      })}
      <button onClick={exportCsv}> Export csv </button>
    </div>
  );
}

export default App;
